import { makeStyles } from "@mui/styles"
import { Typography } from "@mui/material"

const useStyles = makeStyles (() =>({
    container:{
        padding:'0',
        width: '100%',
        height:'100%',



    }
}))
const Page = ({ title,Component }) =>{
    const classes = useStyles()
    return(
        <div className={classes.container}>
            <Typography variant="h3">
                {title}
            </Typography>
            <Component /> 
        </div>
    )
}

export default Page
